import './App.css';

import { useApi } from './hooks/use-api';
import {useState} from 'react';



const exams=[{id: 1, notes:'A note.',image:"../public/imgaes/img1.jpg"},
             {id: 2, notes:'Another note.',image:"../public/imgaes/img2.jpg"},
             {id: 3, notes:'Another note.',image:"../public/imgaes/img3.jpg"},
             {id: 4, notes:'Another note.',image:"../public/imgaes/img4.jpg"},
             {id: 5, notes:'Another note.',image:"../public/imgaes/img5.jpg"},
             {id: 6, notes:'Another note.',image:"../public/imgaes/img6.jpg"},
             {id: 7, notes:'Another note.',image:"../public/imgaes/img7.jpg"},
             {id: 8, notes:'Another note.',image:"../public/imgaes/img8.jpg"},
             {id: 9, notes:'Another note.',image:"../public/imgaes/img9.jpg"},
             {id: 10, notes:'Another note.',image:"../public/imgaes/img10.jpg"}];

function ExamTable(){
  return(
    <ul className='exams'>
      { exams.map(exam => <li key={exam.id}> {exam.notes} </li> ) }
    </ul>
    );
  }


function Hey(){
  let rgbObj={o:0,tw:0,th:0};
  const [count, setCount] = useState(0);
  const [active, setActive] = useState(false);
  const [color, setColor] = useState({o:0,tw:0,th:0});

  function handleClick(){
    setCount(count+1);
    setActive(!active);
    setColor({o:Math.floor(Math.random()*250),tw:Math.floor(Math.random()*250),th:Math.floor(Math.random()*250)})    
  }
  return(
    <button className='heyButton' onClick={handleClick}
    style={{  
      backgroundColor: "rgb("+color.o+","+color.tw+","+color.th+")"
    }}

    >
      This it + {count} + {color.o} + {color.tw} + {color.th}
    </button>
   );
  }


function App() {
  const { response } = useApi();

  return (
    <div className="App">
      <header className="App-header">
        <Hey/>
        <p>
          <ExamTable/>
        </p>
        <p>
          {response}
        </p>
      </header>
    </div>
  );
}

export default App;
